(52, 'купить насос для скважины Балашиха', 'balashiha.kupit@yandex.ru', 'balashiha.kupit@yandex.ru', 'Где можно купить скважинный насос в Балашихе', 'Насос погружной скважинный UNIPUMP ECO MAXI 16-144 - <p> <b>Погружные скважинные насосы UNIPUMP серии ЕСО MAXI</b> — предназначены для подачи чистой холодной воды (без абразивных и волокнистых включений) из скважин с внутренним диаметром не менее 133 мм, глубоких колодцев и открытых водоемов. </p> <p> Область применения — для автономного водоснабжения индивидуальных зданий, коттеджей, дачных домов, для организации полива огородов, садовых участков, наполнения водой резервуаров, а также для обеспечения водой малых гражданских, сельскохозяйственных и производственных объектов. </p> <ul> <li>Максимальная глубина погружения под зеркало воды — 100 м</li> <li>Температура перекачиваемой жидкости — 0…+35°С</li> <li>Температура окружающей среды — 0…+35°С</li> <li>Максимально допустимое количество примесей в перекачиваемой жидкости — не более 100 г/м?</li> <li>Максимальный размер механических примесей — 2 мм</li> <li>pH перекачиваемой жидкости — 6,5…8,5</li> <li>Параметры электросети — 3~, 380 ± 10 % В, 50 Гц</li> <li>Номинальная частота вращения двигателя — 2850 об/мин</li> <li>Встроенная термозащита двигателя*, температура срабатывания теплового реле — ?130°С</li> <li>Степень защиты двигателя — IP68</li> </ul> <p> <i>* Примечание: в двигателях насосов ECO MAXI 23.5-130 и 23.5-173 мощностью 5,5 и 7,5 кВт тепловое реле не установлено.</i> </p> <p> <b>Устройство насоса</b> </p> <p> Насос состоит из электродвигателя и проточной части. Корпус насоса выполнен из нержавеющей стали. Напорный патрубок и адаптер изготовлены из латуни, фланец двигателя изготовлен из чугуна. Электродвигатель — трехфазный, маслонаполненный, со встроенным тепловым реле. Рабочие колеса «плавающие», выполнены из высокопрочного, износоустойчивого поликарбоната. Всасывающее отверстие скважинного насоса располагается в средней части насоса и защищено фильтрующей