(352, 'Afilammek', 'afillans@mulars.ru', 'afillans@mulars.ru', 'Экономика России на 17 августа', 'Песня «Подождем» музыканта Игоря Сорокина (известен под псевдонимом Игорек) стала одним из самых необычных хитов 2000-х, поскольку выгодно выделялась на фоне других поп-композиций российской эстрады. История успеха трека раскрывается во второй части спецпроекта «Ленты.ру» о русской попсе 2000-х. \r\n \r\nОтмечается, что композиция быстро завоевала популярность публики благодаря своей ироничности. «Подождем» сильно отличалась от привычных радиохитов — известные музыканты в то время старались исполнять более «серьезные» песни. \r\n \r\nИгорек, переехавший из Новосибирска в Москву и работавший грузчиком, благодаря знакомому записал трек в столичной студии. Ему удалось протолкнуть песню на радио, после чего та быстро стала хитом в России. Артист снял на «Подождем» недорогой клип, выпустил альбом и отправился в гастроли по стране, пытаясь получить из своей кратковременной популярности «как можно больше». Более хитов Игорек не выпускал. Музыкант якобы до сих пор живет на доходы с песни «Подождем». \r\n \r\nВо второй части спецпроекта «Ленты.ру» об истории русской попсы 2000-х рассказывается о состоянии российской эстрады в 2001 году, фестивале «Нашествие» и певце Витасе, а также о самых громких хитах начала миллениума. \r\n \r\nПартнеры в сети интернет - <a href=https://australia-msk.ru/detskie-uggi/>детские угги</a>', '2021-08-25 08:23:27', '2021-08-25 08:23:27'),
