(364, 'KarinaDROB', '7hcm.chistyukhin2911x1su@gmail.com', '7hcm.chistyukhin2911x1su@gmail.com', 'Коронавирус в Китае: штамм \"Дельта\" занесен из России и разносится пугающими темпами', 'Новая вспышка Covid-19, которую уже назвали самой серьезной после Уханя, охватила по меньшей мере 15 китайских провинций и городов. Власти проявляют все больше беспокойства по поводу уязвимости страны перед более заразным вариантом \"Дельта\".Вся информация о новом шиаме вируса доступна по ссылке : \r\n \r\n<a href=https://belady.online/news/v-chem-plyusy-legalizaczii-prostituczii-v-rossii/></a> \r\n \r\nЗа последние 10 дней дни зарегистрировано более 300 новых случаев заболевания, и каждый день выявляется все больше зараженных. Только 2 августа зарегистрированы 55 новых случаев, из них 40 в провинции Цзяньсу на востоке страны, остальные - в Пекине и провинциях Хуньань, Хубэй, Шандунь, Хэньань, Хайнань и Юньнань, сообщила Национальная комиссия по здравоохранению.', '2021-08-27 01:39:56', '2021-08-27 01:39:56'),
