(371, 'Ramonphali', 'xrumerspamer@gmail.com', 'xrumerspamer@gmail.com', 'medical institute in Uzbekistan', '<a href=https://adti.uz><img src=\"https://i.ibb.co/Db0tQQV/141.jpg\"></a> \r\n \r\n \r\n\r\nOver the years of independence, the institute has trained more than 13000 physicians (including 800 clinical interns, 1116 masters, 200 postgraduates and 20 doctoral students) in various directions.\r\n\r\n870 staff work at the institute at present,<when>] including 525 professorial-teaching staff in 55 departments, 34 of them are Doctors of science and 132 candidates of science. 4 staff members of the professorial-teaching staff of the institute are Honoured Workers of Science of the Republic of Uzbekistan, 3 вЂ“ are members of New-York and 2 вЂ“ members of Russian Academy of Pedagogical Science.\r\n\r\nThe institute has been training medical staff on the following faculties and directions: Therapeutic, Pediatric, Dentistry, Professional Education, Preventive Medicine, Pharmacy, High Nursing Affair and PhysiciansвЂ™ Advanced Training. At present<when>] 3110 students have been studying at the institute (1331 at the Therapeutic faculty, 1009 at the Pediatric, 358 at the Dentistry, 175 students at the Professional Education Direction, 49 at the faculty of Pharmacy, 71 at the Direction of Preventive Medicine, 117 ones study at the Direction of High Nursing Affair).\r\n\r\nToday graduates of the institute are trained in the following directions of master\'s degree: obstetrics and gynecology, therapy (with its directions), otorhinolaryngology, cardiology, ophthalmology, infectious diseases (with its directions), dermatovenereology, neurology, general oncology, morphology, surgery (with its directions), instrumental and functional diagnostic methods (with its directions), neurosurgery, public health and public health services (with its directions), urology, narcology, traumatology and orthopedics, forensic medical examination, pediatrics (with its directions), pediatric surgery, pediatric anesthesiology and intensive care, children\'s cardiology and rheumatology, pediatric neurology, neonatology, sports medicine.\r\n\r\nThe clinic of the institute numbers 700 seats and equipped with modern diagnostic and treating instrumentations: MRT, MSCT, Scanning USI, Laparoscopic Center and others.\r\n\r\nThere are all opportunities to carry out sophisticated educational process and research work at the institute. \r\n \r\nSource: \r\nhttps://adti.uz/doktorantura/ \r\n<a href=https://adti.uz/doktorantura/>medical institute in Uzbekistan</a> \r\n \r\nTags: \r\nmedical institute in Uzbekistan \r\nhuman body anatomy\r\nfirst medical library\r\nis it possible to study in absentia at a medical institute', '2021-08-28 04:40:25', '2021-08-28 04:40:25'),
