(654, 'WinerCaf', 'josephrobertsonw@gmail.com', 'josephrobertsonw@gmail.com', 'В Пентагоне состоялось мероприятие Covid \'superspreader\', озвучил профессор Фаучи', 'Ведущий американский эксперт по вирусам доктор Энтони Фаучи разбранил Белый дом за проведение в прошлом месяце собрания, в связи с пандемией Covid-19. \r\nПрофессор Фаучи, член целевой группы Белого дома по коронавирусу, сказал, что обличение кандидатуры президента Дональда Трампа в Верховный суд было \"сверхпредсказуемым событием\". \r\nПо крайней мере, 11 человек, побывавших на мероприятии 26 сентября, показали положительный результат. \r\nСам Трамп выздоравливает от коронавируса. \r\nДоктора президента только сейчас разрешили ему проводить общественные собрания, меньше месяца до того, как он встретится с кандидатом от демократов Джо Байденом на президентских выборах. \r\nМр. Трамп скептически относится к таким мерам, как маски и блокировка, для борьбы с распространением вируса, от которого погибло более 213000 человек в США. Он говорил о возможностях создания лекарства, хотя исследователи утверждают, что это вряд ли произойдет раньше следующего года. \r\nГолосование показало, что г-н Байден опережает Трампа на одну цифру, а опрос ABC News / Ipsos показал, что лишь 35% американцев одобряют то, как Трамп осилил кризис. \r\nСледующие президентские дебаты на следующей неделе между Трампом и его кандидатом от Демократической партии в Белом доме Джо Байденом теперь официально отменены. \r\nКомиссия по президентским дебатам заявила в заявлении в пятницу, что обе кампании объявили «альтернативные планы на эту дату». \r\nГ-н Трамп отказался по просьбе комиссии прокурировать вскрытие 15 октября практически, чтобы избежать риска распространения коронавируса. \r\nКомиссия заявила, что до сих пор готовится к третьим и заключительным президентским дебатам в Нэшвилле, штат Теннесси, 22 октября. \r\nВ брифинге Трампа говорилось, что комиссия была не честной по отношению к Байдену, а команда демократа обвинила президента в том, что он отказался провести дебаты с ними. Источник <a href=https://rctorg.top/konstruktor-a-pvp-alpha-sk-kirstall.html>https://rctorg.top</a>', '2021-10-24 19:31:04', '2021-10-24 19:31:04'),
