(731, 'Wilsonmat', 'swetafiw2bn@rambler.ru', 'swetafiw2bn@rambler.ru', 'как и с процессоров достают золото', 'Если Ваш компьютер аварийно выключается из-за перегрева процессора при высокой нагрузке на него или Вам не нравится слишком высокая температура процессора, а чистка системного блока и кулера не привела к ожидаемым результатам, тогда этот совет для Вас. Скорее всего, проблема в старой термопасте, которая нанесена на процессор. И в данной статье мы разберем, как заменить термопасту.\r\nДля начала нужно выключить компьютер, отсоединить провода, снять крышку, снять кулер. Итак, после того как мы сняли кулер мы увидим кристалл процессора. Сверху на нем будет высохшее белое вещество – это старая паста. Поэтому перед тем как нанести новую, старую необходимо удалить.\r\n   <a href=https://prohardisoft.ru>обзоры пк</a> \r\n \r\nДля начала нужно выключить компьютер, отсоединить провода, снять крышку, снять кулер. Итак, после того как мы сняли кулер мы увидим кристалл процессора. Сверху на нем будет высохшее белое вещество – это старая паста. Поэтому перед тем как нанести новую, старую необходимо удалить.\r\nДля начала ее нужно купить. Больших объемов нам не потребуется, так как замена происходит очень редко. Термопасту можно купить практически в любом магазине по продажам ПК или заказать в Интернете.', '2021-11-03 16:08:11', '2021-11-03 16:08:11'),
