(970, 'Michaelnip', 'vladgayazov126@gmail.com', 'vladgayazov126@gmail.com', 'Американского журналиста приговорили к 11 годам тюрьмы', 'Милитари суд Мьянмы приговорил журналиста США Дэнни Фенстера к 11 годам тюремного заключения. \r\nФенстер был признан виновным в том, что нарушил закон иммиграции, незаконной ассоциации и поощрении других мыслей против вооруженных сил. \r\nРанее на прошлой неделе ему были предъявлены еще два обвинения в подстрекательстве к мятежу и терроризме, которые предусматривают самое суровое наказание в виде пожизненного заключения. \r\nЕго суд по новым обвинениям состоится 16 ноября. \r\nМолодой человек 37 лет, возглавлявший редакцию портала Frontier Myanmar, был задержан в международном аэропорту Янгона в мае. Он один из десятков местных журналистов, задержанных после военного переворота в феврале. \r\nКак сообщает Frontier, Фенстер ранее работал на независимый новостной портал Myanmar Now, критиковавший ВС после этих событий. \r\n«Доводы основывались на утверждении, что журналист был членом запрещенного средства МИ Myanmar Now. Журналист ушел из Myanmar Now летом 2020 года и присоединился к Frontier в следующем месяце, поэтому на момент ареста в мае 2021 года он сотрудничал с Frontier более девяти месяцев \", - сообщали в новостях. \r\n«Нет никаких причин обвинять Дэнни в этом». \r\nПутч в Мьянме: что происходит и почему? \r\nЕго приговор был вынесен в пятницу через несколько месяцев после ареста японского журналиста-фрилансера в Мьянме подозревающегося в рассылке дизинформации. \r\nЮки Китадзуми, который писал для многих крупных новостных агентств Японии, был редким иностранным репортером в стране. Власти Мьянмы утверждают, что он нарушил закон, но отпустили его по требованию Японии. \r\nИсточник <a href=https://newrush.top>https://newrush.top</a>', '2021-11-21 08:05:43', '2021-11-21 08:05:43'),
