(1231, 'Robertwor', 'valentinakimov9460@rambler.ru', 'valentinakimov9460@rambler.ru', 'электронный авиабилет как бланк строгой отчетности', 'В зоне наблюдаются хроноаномалии с текущим по различному времени. В зоне есть несколько зон:\r\nКуртатинское ущелье – это весьма живописное место в Северной Осетии – Алании. Оно имеет протяженность более 50 км и составляет часть исторической территории Осетии. Здесь не только сказочно красивая природа, но и немалое количество исторических и архитектурных памятников осетинской старины. У самого входа в Куртатинское ущелье, за тесниной Кадаргаван, где бурный, стремительный поток реки Фиагдон плотно обступают горные громады, под скальным выступом между рекой и обрывами горы Кариухох раскинулось древнее селение Дзивгис. В старину через теснину к селению проезжали лишь по опасной узкой тропе. Это место защищало все ущелье и в первую очередь Фиагдонскую котловину, для чего здесь в XIII-XVI вв. выстроили Дзивгис-скую крепость.\r\nСамостоятельные походы в пещеру запрещены. Экскурсии сопровождаются подготовленными гидами, умеющими себя вести в нештатных ситуациях. Поход в подземелье продолжается не более 1,5 часов (температура воздуха там зимой и летом близка к 0°С), стоит от 700 руб. для взрослого и от 500 руб. для ребенка.\r\n \r\nhttps://moooga.ru/portugaliya/puteshestvie-po-portugalii-pikabu/\r\nЗахватывающие дух коридоры подземелий образовались не без участия человека. Раньше в этих местах, по соседству с деревней Борщево, добывали песок для производства стекла.\r\nЗагадочное озеро Шайтанка.', '2022-01-07 03:12:46', '2022-01-07 03:12:46'),
