(1237, 'FreddieKak', 'yourmail@gmail.com', 'yourmail@gmail.com', 'Forex Optimum – международный форекс брокер', 'Forex Optimum – международный форекс брокер, который занимается предоставлением доступа к инвестиционным инструментам и CFD-трейдингу. Если верить информации с официального сайта, то компания была зарегистрирована в 2009 году трейдерами из Восточной Европы. Ее деятельность регулируется частной компанией SVGFSA. Но действительно ли площадка надежная, можно ли ей доверять? Чтобы получить ответ на этот вопрос, мы провели собственное независимое расследование и внимательно изучили все отзывы клиентов, которые ранее сотрудничали с ней. \r\n \r\nСодержание \r\nО компании \r\nУсловия торговли \r\nОфициальный сайт \r\nРегистрация и личный кабинет \r\nПризнаки обмана, мошенничества \r\nОффшорная регистрация \r\nДлительная проверка документов \r\nМало контактов \r\nСомнительные бонусы \r\nОтсутствие лицензии \r\nНегативные отзывы о Forex optimum \r\nО компании \r\nНазвание компании	Forex Optimum, Форекс Оптимум \r\nЛицензия	Нет \r\nТипы счетов \r\nСтандартный \r\nЦентовый \r\nДемо-счет 	Да \r\nТорговые инструменты	Металлы, индексы, валюта, акции, сырье, энергоресурсы \r\nКредитное плечо	1:1000 \r\nТорговый терминал	MetaTrader 4 \r\nУсловия торговли \r\nТорговая площадка Forex Optimum решила не заморачиваться над выгодными условиями для трейдеров и разнообразием счетов, а поэтому предложила только два варианта – стандартный и центовый. Различия между не сильно заметны, но они все же есть: \r\n \r\nВ стандартном счете клиент может воспользоваться такими торговыми инструментами, как металлы, индексы, акции, криптовалюта. Минимальный шаг сделки начинается с 0,01 лота. Размер кредитного плеча составляет 1:1000, нам кажется, что это слишком большой и нереальный показатель. Пополнение минимального депозита возможно только в долларах и евро. Размер комиссии составляет 0,015% от номинального объема торговой операции. \r\nЦентовый счет предполагает использование тех же торговых инструментов, что и в стандартном. Кредитное плечо и минимальный шаг сделки тоже не отличается. Разница только в размере комиссионного сбора. В данном случае он составляет 0,016%. А также в валюте депозита. На этом счете разрешается использовать USD cent и EUR cent. \r\nРазмер спредов зависит от выбранного актива, а также рыночных факторов. Но в любом случае минимальные значения колеблются в районе 1,2 – 2 пунктов. Контора использует торговый терминал MetaTrader 4. Также все пользователи, сотрудничающие с ней, могут скачать мобильную версию терминала и WebTrader. \r\n \r\nForex Optimum не планирует создавать собственные разработки, а предпочитает использовать проверенные временем сервисы. Скорее всего, это связано с нежеланием фирмы вкладывать дополнительные средства. Да и зачем, если все так хорошо работает, для чего лишний раз заморачиваться. \r\n \r\nПополнение депозита и вывод заработанных средств возможно несколькими способами. В основном Forex Optimum предлагает использовать: \r\n \r\nQiwi; \r\nWebmoney; \r\nWire Transfer; \r\nБанковские карты Master Card, Visa; \r\nNeteller; \r\nLPB. \r\nНо, если с пополнением депозита не возникает никаких проблем, деньги приходят практически мгновенно, то с выводом есть трудности. Об этом говорится во многих отзывах клиентов брокера. И это уже первый признак того, что компания ведет своим дела нечестно. Ведь люди отмечают, что Forex Optimum может отказать в выводе средств, не прямо, конечно, а придумывая не одну сотню отмазок. \r\n \r\nОфициальный сайт \r\nДля крупного форекс-дилера сайт довольно простой и незамысловатый. Возможно, с одной стороны это даже плюс, но все же полезной информации на нем мало. В основном, это описание преимуществ сотрудничества с Forex Optimum и обещание «золотых гор». \r\n \r\n \r\n \r\nНа портале даже есть обучающий раздел, однако пользы от него немного. Все данные, которые там размещены, кажется, просто были скопированы с тематических форумов. Никакой авторской информации там нет, а поэтому проходить там обучение смысла нет. Об этом же в своих отзывах говорят и трейдеры, которые пытались обучиться работе с форекс-брокером на этом сайте. \r\n \r\nКстати, стоит сказать и о том, что на сайте минимум контактов, а точнее их вовсе не достаточно. Представители Forex Optimum почему-то уверены, что их клиентам достаточно сообщить только адрес электронной почты. \r\n \r\nРегистрация и личный кабинет \r\nПройти процедуру регистрации здесь несложно. Нужно только указать имя, рабочую электронную почту, номер телефона и выбрать ближайший офис. \r\n \r\n \r\n \r\nДальше открывается страница, на которой нужно заполнить весьма внушительную анкету и указать: \r\n \r\nтип счета; \r\nвыбрать рабочую валюту; \r\nввести персональную информацию (ФИО и дату рождения); \r\nсоздать платежный пароль и нажать на кнопку «Открыть счет». \r\nПосле откроется доступ в личный кабинет Forex Optimum, где уже можно будет выбрать условия торговли и начать зарабатывать. Хотя насчет последнего мы не уверены. Ведь в большинстве отзывов говорится, что практически все выгодные сделки контора сливает еще до их закрытия. \r\n \r\nПризнаки обмана, мошенничества \r\nForex Optimum заботится о своей репутации и активно подчищает неугодные ей отзывы и разоблачающие обзоры. Несмотря на это, мы все равно смогли найти неопровержимые факты, подтверждающие, что организация занимается мошенничеством и обманывает своих клиентов. \r\n \r\nОффшорная регистрация \r\nБрокер зарегистрирован в оффшорах. Это один из главных признаков нечестности фирмы. Ведь при возникновении спорных ситуаций и отказе возвращать деньги трейдеру, ее никто не найдет и не заставит вернуть заработок. \r\n \r\nК тому же, по указанному адресу расположено еще с десяток подобных «солидных организаций», а не только Forex Optimum. Очевидно, что адрес фейковый. \r\n \r\nДлительная проверка документов \r\nЧтобы иметь возможность выводить заработанные средства, трейдеру нужно предоставить документы, подтверждающие личность и подождать их автори