(1247, 'Robertwor', 'valentinakimov9460@rambler.ru', 'valentinakimov9460@rambler.ru', 'через какой сайт заказать авиабилет', 'Водоем располагается на черноморском побережье, в окрестностях города Поти. Синяя гладь, камышовые заросли, дикие луга — живописный пейзаж притягивает туристов.\r\nВ пешеходной части маршрута предусмотрено 4-дневное пребывание в Национальном парке с подъемом на вершины местных гор и с посещением природного Лесного фонтана. Далее -инструктаж по безопасности и знакомство с техникой гребли на катамаране, ведь предстоит сплав по спокойной реке Ай. Появляется возможность порыбачить и искупаться.\r\nВулкан Гирвас (Кондопожский р-н). Самый древний спящий вулкан на севере, ему несколько миллиардов лет. Поле лавы растянулось на километры. Поражает сочетание камней, зелени и песчаных дюн. Вокруг создан ухоженный экопарк с платным входом.\r\n \r\nhttps://moooga.ru/pokupka-aviabiletov/mozhno-li-vernut-dengi-za-aviabilety-kuplennye-cherez-internet-kak-vernut-dengi-za-aviabilet-pravila-i-sovety/\r\nМиллионы лет назад здесь было дно моря, а будущие горы представляли собой коралловые рифы. Из-за этого бывшее морское дно – Фишт-Оштенский горный массив с главными вершинами Оштен, Фишт и Пшехо-Су – называют коралловым островом. Вознесенный на почти трехкилометровую высоту морской риф из песчаника насквозь пронизан коралловыми ветвями.\r\nЧто посмотреть : река Синара.', '2022-01-11 05:42:51', '2022-01-11 05:42:51'),
