(1479, 'Vladimir G', 'opo427869@gmail.com', 'opo427869@gmail.com', 'Removе negative review', 'Hello, I want to get right to the point, since I know you are busy. I noticed that you have unfavorable reviews on the first page of Google maps. I would like to offer you my services to enhance your image, and I have experience with different lines of business. \r\nYou have to understand that 80% of customers read reviews and look at ratings on the internet before they make a choice to visit a place. \r\nI am sure that if you had a choice, you would want the reviews of your company to be better. I am willing to work with you to increase the amount of positive reviews and thereby make your establishment better in the eyes of new customers. \r\nI can offer both one-time filling of reviews, and permanent monthly support.. \r\nIt is also possible to remove already existing negative or false reviews. \r\nPayment only after the result. \r\nIf you are interested in cooperation, contact us at customreviewclub@gmail.com', '2022-05-29 08:25:28', '2022-05-29 08:25:28'),
