(14, 15, 16, '123', '1234', 'Slanetrac HT 1000 Diesel', 'HT 1000 Diesel', '2021', '0', '1', '<div class=\"one_half et_column_last\" style=\"margin-top: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; float: left; position: relative; width: 351.906px; clear: right; text-align: justify; margin-right: 0px !important;\"><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%;\">The Slanetrac HT 1000 Diesel Track Dumper is hydraulically driven and comes with braked drive motors.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%;\">This compact Track Dumper has a maximum width of 750mm and a length of 1900mm.It can turn on its own length offering greater accessibility and maneuverability in urban areas or areas where larger plant can’t gain access.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%;\"></p></div><div class=\"clear\" style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%; clear: both; text-align: justify;\"></div><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%;\"></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%;\">Complete with hi tipping capacity; the Slanetrac HT1000 Diesel Track Dumper offers a tipping height of 1300mm, and easily tips into skips.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%;\">With a very low ground pressure and rubber tracks, the Slanetrac HT1000 offers minimum ground damage, while excellent gradability and stability ensure safe operating of the dumper.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 1em; border: 0px; outline: 0px; background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline; text-size-adjust: 100%;\">Powered by a Kohler KDW702 16.5hp (12.3kw) electric start, water cooled engine; this robustly built Track Dumper has a load capacity of 1 ton. Complete with hi tipping capacity the Slanetrac HT1000 offers a tipping height of 1300mm and easily tips into skips. With a very low ground pressure and rubber tracks the Slanetrac HT1000 offers minimum ground damage while excellent gradability and stability ensure safe operating of the dumper.</p>', 12000, 'New', '1t-tracked_dumper.pdf', 'Sold', 0, '2021-04-28', 56, '2021-04-28 22:43:19', '2021-07-09 12:06:23'),
(15, 15, 16, '1', '0', 'Slanetrac HT 1000 Petrol', 'HT1000 Petrol', '2021', '0', '1', '<p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">This compact Track Dumper has a maximum width of 750mm and a length of 1900mm.It can turn on its own length offering greater accessibility and manoeuvrability in urban areas or areas where the larger plant cannot gain access.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">Complete with hi tipping capacity; the Slanetrac HT1000 Petrol Track Dumper offers a tipping height of 1300mm, and easily tips into skips.</p><p style=\"margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">With a very low ground pressure and rubber tracks, the Slanetrac HT1000 offers minimum ground damage, while excellent gradability and stability ensure safe operating of the dumper.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px;\">Powered by a 13 H.P Honda GX 390 electric start engine this robustly built Track Dumper has a load capacity of 1 ton. Complete with hi tipping capacity the Slanetrac HT1000 offers a tipping height of 1300mm and easily tips into skips. With a very low ground pressure and rubber tracks the Slanetrac HT1000offers minimum ground damage while excellent gradability and stability ensure safe operating of the dumper.</p>', 10000, 'New', 'petrol slanetrac.pdf', 'Sold', 0, '2021-06-01', 57, '2021-06-01 15:30:50', '2021-08-04 14:12:41'),
(36, 4, 11, '0', '0', 'NC 1.0 HT', '1.0 HT', '2021', '0', '1', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Powerful, Compact, 4 Wheel Drive, Hydrostatic&nbsp; Dumper</p><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li>Power is provided by the reliable Kubota D series engine</li><li>Automotive DA controlled pump provides safe and smooth control at all times.</li><li>Twin-Lock wheel motors provides power to each wheel via its own dual hydraulic motor . As one wheel starts to lose traction, the power is distributed to the other wheels to compensate thus giving Intelligent 4 wheel drive.</li><li>With a steering angle of +/- 36° and gradeability of 50% this makes the HT 1.0 series dumper an effective tool for hard to access sites with difficult terrain.</li><li>Steering: Priority load sensing hydrostatic centre pivot</li><li>Working brakes: Hydrostatic retardation</li><li>Park brake: Automatic in rear wheel motors</li><li style=\"margin-bottom: 0px;\">Two Widths available our standard 1117mm or the narrow access option 982mm</li></ul><h5 style=\"line-height: 18px; margin-bottom: 15px;\"><b>FEATURES</b></h5><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li style=\"\">Unrivalled operator access &amp; comfort</li><li style=\"\">Excellent rough terrain performance from permanent 4-wheel drive</li><li style=\"\">Heavy duty construction</li><li style=\"\">Column operated forward and reverse directions with acceleration&nbsp;by foot pedal</li><li style=\"\">Simple and safe operation; drive direction on the steering column</li><li style=\"\">Simple instrument panel including fuel gauge, hour meter, warning&nbsp;lights for parking brake, oil temperature, oil pressure, engine&nbsp;temperature</li><li style=\"\">Folding ROPS as standard</li><li style=\"\">Flashing beacon as standard</li><li style=\"\">Easy access to engine compartment for service &amp; maintenance</li><li style=\"\">Recovery hitch as standard</li><li style=\"\">24 HP engine (18kW)</li><li style=\"\">Excellent power to weight ratio</li><li style=\"\">Ample ground clearance</li><li style=\"\">Excellent turning circle</li><li style=\"\">Reversing alarm as standard</li><li style=\"\">Separate fuel and hydraulic oil filler compartments</li><li style=\"\">Skip tips to 90º</li><li style=\"margin-bottom: 0px;\">Adjustable suspension seat</li></ul>', 0, 'New', '1-1.5-Site-Dumper-Brochure (1).pdf', 'Sold', 0, '2021-06-01', 46, '2021-06-01 17:31:52', '2021-07-09 12:06:23'),
(37, 4, 11, '0', '0', 'NC 1.5 HIGH TIP', '1.5 HIGH TIP', '2021', '0', '1.5', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Powerful, Compact, 4 Wheel Drive, Hydrostatic&nbsp; Dumper&nbsp;</p><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li>Power is provided by the reliable Kubota D series engine</li><li>Automotive DA controlled pump provides safe and smooth control at all times.</li><li>Twin-Lock wheel motors provides power to each wheel via its own dual hydraulic motor . As one wheel starts to lose traction, the power is distributed to the other wheels to compensate thus giving Intelligent 4 wheel drive.</li><li>With a steering angle of +/- 36° and gradeability&nbsp; of 50% this makes the HT 1.0 series dumper an effective tool for hard to access sites with difficult terrain.</li><li>Steering: Priority load sensing hydrostatic centre pivot</li><li>Working brakes: Hydrostatic retardation</li><li>Park brake: Automatic in rear wheel motors</li><li style=\"margin-bottom: 0px;\">Two versions available High Tip or Powerswivel</li></ul><h5 style=\"line-height: 18px; margin-bottom: 15px;\"><b>FEATURES</b></h5><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li style=\"\">Unrivalled operator access &amp; comfort</li><li style=\"\">Excellent rough terrain performance from permanent 4-wheel drive</li><li style=\"\">Heavy duty construction</li><li style=\"\">Column operated forward and reverse directions with acceleration&nbsp;by foot pedal</li><li style=\"\">Simple and safe operation; drive direction on the steering column</li><li style=\"\">Simple instrument panel including fuel gauge, hour meter, warning&nbsp;lights for parking brake, oil temperature, oil pressure, engine&nbsp;temperature</li><li style=\"\">Folding ROPS as standard</li><li style=\"\">Flashing beacon as standard</li><li style=\"\">Easy access to engine compartment for service &amp; maintenance</li><li style=\"\">Recovery hitch as standard</li><li style=\"\">24 HP engine (18kW)</li><li style=\"\">Excellent power to weight ratio</li><li style=\"\">Ample ground clearance</li><li style=\"\">Excellent turning circle</li><li style=\"\">Reversing alarm as standard</li><li style=\"\">Separate fuel and hydraulic oil filler compartments</li><li style=\"\">Skip tips to 90º(high tip) 2 lever control</li><li style=\"margin-bottom: 0px;\">Adjustable suspension seat</li></ul>', 0, 'New', 'Site-Dumper-Brochure-HT-1.0-HT-1.5-and-SW-1.5-August-2019.pdf', 'In Stock', 0, '2021-06-01', 47, '2021-06-01 18:16:11', '2021-06-24 15:04:33'),
(38, 4, 11, '0', '0', 'NC 1.5 POWER SWIVEL', '1.5 POWER SWIVEL', '2021', '0', '1.5', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Powerful, Compact, 4 Wheel Drive, Hydrostatic&nbsp; Dumper&nbsp;</p><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li>Power is provided by the reliable Kubota D series engine</li><li>Automotive DA controlled pump provides safe and smooth control at all times.</li><li>Twin-Lock wheel motors provides power to each wheel via its own dual hydraulic motor . As one wheel starts to lose traction, the power is distributed to the other wheels to compensate thus giving Intelligent 4 wheel drive.</li><li>With a steering angle of +/- 36° and gradeability&nbsp; of 50% this makes the HT 1.5 series dumper an effective tool for hard to access sites with difficult terrain.</li><li>Steering: Priority load sensing hydrostatic centre pivot</li><li>Working brakes: Hydrostatic retardation</li><li>Park brake: Automatic in rear wheel motors</li><li style=\"margin-bottom: 0px;\">Powerswivel</li></ul><h5 style=\"line-height: 18px; margin-bottom: 15px;\"><b>FEATURES</b></h5><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li style=\"\">Unrivalled operator access &amp; comfort</li><li style=\"\">Excellent rough terrain performance from permanent 4-wheel drive</li><li style=\"\">Heavy duty construction</li><li style=\"\">Column operated forward and reverse directions with acceleration&nbsp;by foot pedal</li><li style=\"\">Simple and safe operation; drive direction on the steering column</li><li style=\"\">Simple instrument panel including fuel gauge, hour meter, warning&nbsp;lights for parking brake, oil temperature, oil pressure, engine&nbsp;temperature</li><li style=\"\">Folding ROPS as standard</li><li style=\"\">Flashing beacon as standard</li><li style=\"\">Easy access to engine compartment for service &amp; maintenance</li><li style=\"\">Recovery hitch as standard</li><li style=\"\">24 HP engine (18kW)</li><li style=\"\">Excellent power to weight ratio</li><li style=\"\">Ample ground clearance</li><li style=\"\">Excellent turning circle</li><li style=\"\">Reversing alarm as standard</li><li style=\"\">Separate fuel and hydraulic oil filler compartments</li><li style=\"\">Skip swivels 180°via joystick control</li><li style=\"margin-bottom: 0px;\">Adjustable suspension seat</li></ul>', 0, 'New', 'SW3-Spec-Sheet-_En_-Rev-3.0-August-2016.pdf', 'In Stock', 0, '2021-06-01', 48, '2021-06-01 18:19:20', '2021-06-24 15:04:33'),
(39, 4, 11, '0', '0', 'NC 3.0 ST', '3.0 POWER SWIVEL', '2021', '0', '3', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Powerful, Robust, 4 Wheel Drive, 2 speed Hydrostatic&nbsp; Dumper</p><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li>Power is provided by the reliable Kubota engine 27kW</li><li>Rexroth DA controlled pump &amp; 2 speed motor provides safe and smooth control at all times.</li><li>A steering angle of +/-33° and climbing gradeability&nbsp;of 50% make the NC 3 Tonne Series dumper an effective tool for the most challenging of sites.</li><li>2 Speed automatic seamless gear change on the go (selectable low gear if required)</li><li>Steering: Priority load sensing hydrostatic centre pivot</li><li>Working brakes: Multi plate oil immersed discs mounted in the front axle</li><li>Park brake: Hand operated locking on a disc on the front axle</li><li style=\"margin-bottom: 0px;\">Two versions available Front Tip or Powerswivel</li></ul><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><b>Features:</b></p><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li style=\"\">Unrivalled operator accessibility and comfort</li><li style=\"\">Power swivel skip enabling discharge either side</li><li style=\"\">Excellent rough terrain performance from permanent 4-wheel drive</li><li style=\"\">Heavy duty construction</li><li style=\"\">Column operated forward and reverse directions with acceleration by foot pedal</li><li style=\"\">Simple and safe operation, drive direction on the steering column</li><li style=\"\">Heavy duty centre console for leg protection</li><li style=\"\">Simple instrument panel including fuel gauge, hour meter, warning lights for</li><li style=\"\">parking&nbsp; brake, oil temperature, oil pressure, engine temperature</li><li style=\"\">Folding ROPS as standard</li><li style=\"\">Easy access to engine compartment for service and maintenance</li><li style=\"\">36hp / 27kW Engine</li><li style=\"\">Excellent turning circle</li><li style=\"\">Skip swivels through 180º for easy placement of load when driving along trenches</li><li style=\"\">Reversing alarm standard</li><li style=\"\">Handbrake safety device – will not move until released</li><li style=\"\">Adjustable suspension seat</li><li style=\"margin-bottom: 0px;\">Flashing beacon</li></ul>', 80, 'New', 'ST3-Spec-Sheet-_En_-Rev-1.0-October-2016 (1).pdf', 'In Stock', 0, '2021-06-01', 49, '2021-06-01 18:43:18', '2021-06-24 15:04:33'),
(40, 4, 11, '0', '0', 'NC 3.0 ST', '3.0 ST', '2021', '0', '3', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Powerful, Robust, 4 Wheel Drive, 2 speed Hydrostatic&nbsp; Dumper</p><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li>Power is provided by the reliable Kubota engine 27kW</li><li>Rexroth DA controlled pump &amp; 2 speed motor provides safe and smooth control at all times.</li><li>A steering angle of +/-33° and climbing gradeability&nbsp;of 50% make the NC 3 Tonne Series dumper an effective tool for the most challenging of sites.</li><li>2 Speed automatic seamless gear change on the go (selectable low gear if required)</li><li>Steering: Priority load sensing hydrostatic centre pivot</li><li>Working brakes: Multi plate oil immersed discs mounted in the front axle</li><li>Park brake: Hand operated locking on a disc on the front axle</li><li style=\"margin-bottom: 0px;\">Two versions available Front Tip or Powerswivel</li></ul><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\"><b>Features:</b></p><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li style=\"\">Unrivalled operator accessibility and comfort</li><li style=\"\">Power swivel skip enabling discharge either side</li><li style=\"\">Excellent rough terrain performance from permanent 4-wheel drive</li><li style=\"\">Heavy duty construction</li><li style=\"\">Column operated forward and reverse directions with acceleration by foot pedal</li><li style=\"\">Simple and safe operation, drive direction on the steering column</li><li style=\"\">Heavy duty centre console for leg protection</li><li style=\"\">Simple instrument panel including fuel gauge, hour meter, warning lights for</li><li style=\"\">parking&nbsp; brake, oil temperature, oil pressure, engine temperature</li><li style=\"\">Folding ROPS as standard</li><li style=\"\">Easy access to engine compartment for service and maintenance</li><li style=\"\">36hp / 27kW Engine</li><li style=\"\">Excellent turning circle</li><li style=\"\">Skip swivels through 180º for easy placement of load when driving along trenches</li><li style=\"\">Reversing alarm standard</li><li style=\"\">Handbrake safety device – will not move until released</li><li style=\"\">Adjustable suspension seat</li><li style=\"margin-bottom: 0px;\">Flashing beacon</li></ul>', 0, 'New', 'ST3-Spec-Sheet-_En_-Rev-1.0-October-2016 (1) (1).pdf', 'In Stock', 0, '2021-06-01', 50, '2021-06-01 18:46:25', '2021-06-24 15:04:33'),
(41, 4, 11, '0', '0', 'NC 9.0 SW', '9.0 SW', '2021', '0', '9', '<p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px;\">Powerful, Reliable, Rugged 4 Wheel Drive, 4 speed Powershuttle Dumper (For Non Emissions compliant markets)<br style=\"margin-bottom: 0px;\"></p><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li>&nbsp;Power is provided by the JCB Dieselmax 3.6 Engine with 85kW (Eu Stage IIIA emissions)</li><li>JCB Powershuttle 4 speed transmission</li><li>Permanent 4 wheel drive.</li><li>With a steering angle of +/- 36° and gradeability&nbsp; of 50% this makes the 9 Tonne series dumper the perfect bulk carrier.</li><li>4 speed 0-32kph ideal for covering large areas</li><li>Steering: Priority load sensing hydrostatic centre pivot</li><li>Working brakes: Multi-plate oil immersed discs mounted on both axles</li><li>Park brake: Hand operated locking on a dry disc acting on the gearbox</li><li style=\"margin-bottom: 0px;\">Two versions Front Tip and Powerswivel</li></ul><h5 style=\"line-height: 18px; margin-bottom: 15px;\"><b>FEATURES</b></h5><ul style=\"margin: 16px 0px; padding: 0px 0px 0px 25px;\"><li style=\"\">Unrivalled operator accessibility and comfort</li><li style=\"\">Power swivel skip enabling discharge either side</li><li style=\"\">Excellent rough terrain performance from permanent 4-wheel drive</li><li style=\"\">Heavy duty construction; skip manufactured from 8 mm steel plate and reinforced around top</li><li style=\"\">Column operated forward and reverse directions with acceleration by foot pedal</li><li style=\"\">Simple and safe operation; drive direction on the steering column</li><li style=\"\">Heavy duty all steel centre console for increased leg protection</li><li style=\"\">Simple instrument panel including fuel gauge, hourmeter, warning lights for-parking brake, oil temperature, oil pressure, engine temperature</li><li style=\"\">Folding ROPS as standard</li><li style=\"\">Easy access to engine compartment for service and maintenance</li><li style=\"\">Recovery bracket as standard</li><li style=\"\">Excellent power to weight ratio</li><li style=\"\">Ample ground clearance</li><li style=\"\">Superior turning circle</li><li style=\"\">Skip swivels over 180º for easy placement when driving along trenches (185º maximum)</li><li style=\"\">Skip tips over 90º</li><li style=\"\">Reversing alarm standard</li><li style=\"\">Handbrake safety device – will not move until released</li><li style=\"\">Separate fuel and hydraulic filler compartments</li><li style=\"\">Adjustable suspension seat</li><li style=\"margin-bottom: 0px;\">Flashing beacon</li></ul>', 0, 'New', 'SW9-Stage-3A-Spec-Sheet-_En_-Rev-2.0-August-2016.pdf', 'In Stock', 0, '2021-06-01', 51, '2021-06-01 18:50:59', '2021-06-24 15:04:33'),
(44, 5, 10, '0', '0', 'Liugong 909ECR', '909ECR', '2021', '0', '9', '<ul style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; margin: 10px 0px 0px; padding: 0px 15px 10px 30px; list-style: none; border: none; background-image: url(&quot;../images/kv/bg.png&quot;); background-position: initial; background-size: initial; background-repeat: repeat; background-attachment: initial; background-origin: initial; background-clip: initial;\"><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">The 909ECR model features a short tail swing design. On this model, if you are working in a confined space the short tail swing ensures safe and easy operation within a confined space.</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">The fuel efficient, Stage IIIB / Tier 4 certified Yanmar 4TNV98C engine provides proven and reliable power.</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">The hydraulic system provides a load sensing and flow sharing capability leading to operational precision, efficient performance and greater controllability.</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">When it works alongside obstacles, the swing post and cylinder stay within the tracks when in an offset position, so that you can avoid the risk of damage to your machine.</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">The float function can be enabled with a toggle switch on the right side of the control panel. Because you don’t have to adjust the blade height during travel, cleanup and backfilling will be easier.</li></ul>', 0, 'New', '909ECR IIIB 12 Pg A4 Broch_12_2020.pdf', 'Sold', 0, '2021-06-01', 42, '2021-06-01 19:07:00', '2021-08-30 15:56:18'),
(46, 5, 10, '0', '0', 'Liugong 913E', '913E', '2021', '0', '14', '<ul style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; margin: 10px 0px 0px; padding: 0px 15px 10px 30px; list-style: none; border: none; background-image: url(&quot;../images/kv/bg.png&quot;); background-position: initial; background-size: initial; background-repeat: repeat; background-attachment: initial; background-origin: initial; background-clip: initial;\"><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\"><span class=\"VIiyi\" jsaction=\"mouseup:BR6jm\" jsname=\"jqKxS\" style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px; list-style: none; border: none;\">Tailored engine specifications and customized curves according to application requirements, low speed and high torque, good transient response, and improved acceleration and operating efficiency of the whole machine.</span></li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\"><span class=\"VIiyi\" jsaction=\"mouseup:BR6jm\" jsname=\"jqKxS\" style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px; list-style: none; border: none;\">Multi-function electronic control guarantee, strong self-diagnosis, monitoring, protection ability, safe, reliable and easy to control, realize remote monitoring and management.</span></li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\"><span class=\"VIiyi\" jsaction=\"mouseup:BR6jm\" jsname=\"jqKxS\" style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px; list-style: none; border: