(49, 5, 10, '0', '0', 'Liugiong  915E－Stage IV', '915E－Stage IV', '2021', '0', '15', '<ul style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; margin: 10px 0px 0px; padding: 0px 15px 10px 30px; list-style: none; border: none; background-image: url(&quot;../images/kv/bg.png&quot;); background-position: initial; background-size: initial; background-repeat: repeat; background-attachment: initial; background-origin: initial; background-clip: initial;\"><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">Proven negative flow hydraulics have optimize the main control valve, improved the speed of front end cylinders, while cutting down the hydraulic system’s damper loss, leading to much better working efficiency. The pilot valves matching with the main control valve offer precise control.</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">The 915E model is powered by the latest generation, low emission Cummins engine, with enhanced power output, improved breakout force and faster cycle times.</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">The LiuGong E series excavator features 6 selectable working modes that optimize performance and fuel consumption to your specific conditions</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">Ergonomically designed cab for LiuGong E series excavator, with great visibility, expansive leg room, new multi-function LCD monitor, automatic air conditioner, large storage space, provide most comfortable working environment</li></ul>', 0, 'New', '915E T4f 16 pg a4 broch_12_2020.pdf', 'Sold', 0, '2021-06-01', 39, '2021-06-01 19:19:23', '2021-07-28 14:29:04'),
(50, 12, 15, '0', '0', 'Aquamist Dust Suppression', 'Aquamist Dust Suppression', '2021', '0', '0', '<p>Terex has developed the Aquamist dust suppression system,&nbsp;<span style=\"caret-color: auto;\">an improvement over conventional jets or water-sprays.</span>&nbsp;<span style=\"caret-color: auto;\">They are a high capacity misting fan which produces&nbsp;</span><span style=\"caret-color: auto;\">finely divided water droplets in the size range 10-150&nbsp;</span>&nbsp;<span style=\"caret-color: auto;\">micron diameter. At this size they can easily combine&nbsp;</span><span style=\"caret-color: auto;\">themselves with dust particles of similar dimensions and&nbsp;</span>&nbsp;<span style=\"caret-color: auto;\">precipitate them out of the air. Because water-mists “float”&nbsp;</span>&nbsp;<span style=\"caret-color: auto;\">more than a conventional spray it covers and envelops the&nbsp;</span>&nbsp;<span style=\"caret-color: auto;\">dust cloud more effectively.</span><br></p>', 0, 'Used', '', 'Sold', 0, '2021-07-01', 2, '2021-06-01 19:22:00', '2021-09-10 19:18:43'),
(54, 3, 9, '0', '0', 'Dressta TD-15', 'TD-15', '2021', '0', '20.6', '<div class=\"content\" style=\"font-family: Arial, sans-serif, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(251, 251, 251);\"><h2 style=\"font-family: Arial, sans-serif; line-height: 30px; color: rgb(75, 75, 75); margin-right: 0px; margin-bottom: 20px; margin-left: 0px; font-size: 21px;\">The TD-15 medium crawler dozer Series are available in several versions starting from 190hp with an operating weight of 21.3t. These powerful dozers blend brute force with predicable and precise control and are engineered for optimum performance in road construction, land clearing and on construction sites.</h2><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 20px;\">Customers can specify their machines in either Standard (STD), Wide Track (WT) Long Track (LT) or Low Ground Pressure (LGP) versions. The machines can also be engineered for superior performance in Landfill Applications (LA).<br>View the full specifications, options, SFRs and videos of the TD-15 in action below.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 20px;\">If you cannot find the model below with the appropriate engine configuration (Emission Levels: Tier 3, Tier 4 Interim, Tier 4 Final) for your region, please&nbsp;<a title=\"email us\" href=\"mailto:info@dressta.com\" style=\"color: rgb(51, 122, 183);\">email us</a>&nbsp;or&nbsp;<a rel=\"noopener\" href=\"https://www.dressta.com/en_GB/sales-and-support/find-a-dealer/\" target=\"_blank\" style=\"color: rgb(51, 122, 183);\">contact your local dealer</a>.</p><div><br></div></div>', 0, 'New', '', 'In Stock', 0, '2021-06-01', 4, '2021-06-01 19:30:59', '2021-09-10 19:18:15'),
(59, 3, 9, '0', '0', 'Dressta TD-25', 'TD-25', '2021', '0', '41.2', '<h2 style=\"line-height: 30px; margin-right: 0px; margin-bottom: 20px; margin-left: 0px;\">The Dressta TD-25 Series is the first of our heavy-duty crawler dozer range, starting with a net flywheel power of 375 hp (280 kW) and an operating weight of 41.5t. The machines are built to excel in heavy mining, coal and construction projects, incorporating advanced technologies and components for optimal performance.</h2><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 20px;\">The TD-25 Series machines can be specified in Standard (STD), XP and Landfill Application (LA) versions, but can be further modified to meet specific customer requirements through Dressta\'s Special Feature Requests (SFRs) initiative.<br>View the full specifications, options, SFRs and videos of the TD-25 in action below.</p><p style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 20px;\">If you cannot find the model below with the appropriate engine configuration (Emission Levels: Tier 3, Tier 4 Interim, Tier 4 Final) for your region, please&nbsp;<a title=\"email us\" href=\"mailto:info@dressta.com\" style=\"\">email us</a>&nbsp;or&nbsp;<a rel=\"noopener\" href=\"https://www.dressta.com/en_GB/sales-and-support/find-a-dealer/\" target=\"_blank\" style=\"\">contact your local dealer</a>.</p>', 0, 'New', '', 'In Stock', 0, '2021-06-01', 5, '2021-06-01 19:38:50', '2021-06-24 15:04:33'),
(94, 5, 10, '0', '0', 'Liugong 950E－Stage V', '950E－Stage V', '2021', '0', '50', '<p style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">You don’t need to be told it’s a tough world. It’s your reality, you live it every day and\r\nyou know how hard it can be on your people and your machines. It’s getting tougher\r\nto make your business pay too, with rising costs, increasing legislation and greater\r\ncompetition. We understand and we’ve put that understanding into action with our\r\nnew 950E.<br></p>', 0, 'New', 'HEX-950E-Stage-V-32-Pg-A4-Broch_06_2020.pdf', 'Sold', 0, '2021-06-02', 44, '2021-06-02 12:49:42', '2021-09-06 15:55:15'),
(97, 5, 10, '0', '0', 'Liugong 9018F－Tier 4F / Stage V', '9018F－Tier 4F / Stage V', '2021', '0', '2', '<ul style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; margin: 10px 0px 0px; padding: 0px 15px 10px 30px; list-style-position: initial; list-style-image: initial; border: none; background-image: url(&quot;../images/kv/bg.png&quot;); background-position: initial; background-size: initial; background-repeat: repeat; background-attachment: initial; background-origin: initial; background-clip: initial;\"><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">With high-visibility cabs, protected by ROPS &amp; TOPS</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">Save more with the optional&nbsp; AUTO-IDLE speed function</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">When space is tight, the neat compact design with short tail swing gets you to work</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">Control is everything. Load sensing hydraulics deliver precise and smooth operation for excellent grading performance</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">The fuel efficient, low noise and low emission Stage V certified Yanmar 3TNV80F-SSLY engine gives the operator the power to perform</li></ul>', 0, 'New', '9018F Stage V 16 Pg A4 Broch_11_2020.pdf', 'In Stock', 0, '2021-06-02', 40, '2021-06-02 12:59:04', '2021-06-24 15:04:33'),
(99, 5, 10, '0', '0', 'Liugong 9035E－Tier 4F / Stage V', '9035E－Tier 4F / Stage V', '2021', '0', '4', '<ul style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; margin: 10px 0px 0px; padding: 0px 15px 10px 30px; list-style-position: initial; list-style-image: initial; border: none; background-image: url(&quot;../images/kv/bg.png&quot;); background-position: initial; background-size: initial; background-repeat: repeat; background-attachment: initial; background-origin: initial; background-clip: initial;\"><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\"><span style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px; list-style: none; border: none;\">Zero tail swing</span></li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\"><span style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px; list-style: none; border: none;\">Ergonomically designed cab and ergonomic placement of instruments</span></li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\"><span style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px; list-style: none; border: none;\">Open ROPS available</span></li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\"><span style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px; list-style: none; border: none;\">Hammer/Shear hydraulics and piping</span></li></ul>', 0, 'New'