(122, 14, 13, 'ABC123', '0', 'Kubota K008-3', 'K008-3', '2021', '0', '1', '<p>Super-compact. Highly reliable.&nbsp;<span style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 0.875rem;\">The efficient Kubota K008-3, with enhanced operator protection, is the super mini-excavator of choice for tough jobs where space is limited.</span></p>', 0, 'New', 'K008-3-EN_HD.pdf', 'In Stock', 0, '2021-06-02', 14, '2021-06-02 14:12:48', '2022-02-15 17:38:17'),
(123, 14, 13, '0', '0', 'Kubota KX015-4', 'KX015-4', '2021', '0', '14', '<p>Kubota’s new KX015-4 mini excavator raises the standard in the 1.5-2.0 tonne category with a powerful digging force and a wider working range that rival higherend excavators. And with enhanced accessibility to sites such as roadsides or residential areas, the KX015-4 gets the jobs done easier from large construction areas to small places.<br></p>', 0, 'New', 'KX015-4-1.pdf', 'Sold', 0, '2021-06-02', 16, '2021-06-02 14:17:16', '2021-07-09 17:26:21'),
(124, 14, 13, '0', '0', 'Kubota KX016-4', 'KX016-4', '2021', '0', '15', '<p>The KX016-4 mini excavators deliver a powerful digging force and a wider working range that rival higher end excavators. And with enhanced accessibility to sites such as roadsides or residential areas, these versatile machines get the job done easier and efficiently.<br></p>', 0, 'New', 'KX016-4.pdf', 'Sold', 0, '2021-06-02', 17, '2021-06-02 14:20:13', '2021-07-14 13:55:42'),
(125, 14, 13, '0', '0', 'Kubota KX018-4', 'KX018-4', '2021', '0', '16', '<p>Kubota’s new KX018-4 mini excavator raises the standard in the 1.5-2.0 tonne&nbsp;category with a powerful digging force and a wider working range that rival&nbsp;higher-end excavators. And with enhanced accessibility to sites such as&nbsp;roadsides or residential areas, the KX018-4 gets the jobs done easier from large&nbsp;construction areas to the tightest of places.<br></p>', 0, 'New', 'KX018-4 tech.pdf', 'Sold', 0, '2021-06-02', 19, '2021-06-02 14:21:46', '2021-07-15 12:59:08'),
(126, 14, 13, '0', '0', 'Kubota KX019-4', 'KX019-4', '2021', '0', '18', '<p>Kubota’s new KX019-4 mini excavator raises the standard in the 1.5-2.0 tonne category with a powerful digging force and a wider working range that rival higherend excavators. And with enhanced accessibility to sites such as roadsides or residential areas, the KX019-4 gets the jobs done easier from large construction areas to the tightest of places.<br></p>', 0, 'New', 'KX019-4.pdf', 'Sold', 0, '2021-06-02', 20, '2021-06-02 14:23:32', '2021-07-15 14:35:00'),
(127, 14, 13, '0', '0', 'Kubota KX027-4', 'KX027-4', '2021', '0', '26', '<p style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); margin: 24px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline; outline: none !important;\">Power and performance in a compact excavator and the largest cab in it’s class.</p><div><br></div>', 0, 'New', 'KX027-4.pdf', 'Sold', 0, '2021-06-02', 23, '2021-06-02 14:25:15', '2021-07-26 09:47:41'),
(128, 14, 13, '0', '0', 'Kubota KX030-4', 'KX030-4', '2021', '0', '28', '<p>When the space is tight and the job is challenging,&nbsp;send in the KX030-4. As a compact excavator that doesn’t compromise on power or performance, it’ll&nbsp;give you the ability to work with remarkable ease and efficiency.<br style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); outline: none !important;\">With an ergonomic design and&nbsp;the biggest cab in its class, the KX030-4 will also let you work comfortably all day long.<br></p>', 0, 'New', 'KX030-4.pdf', 'Sold', 0, '2021-06-02', 22, '2021-06-02 14:26:36', '2021-07-26 09:47:41'),
(129, 14, 13, '0', '0', 'Kubota KX037-4', 'KX037-4', '2021', '0', '4', '<p>The new KX037-4 replaces the KX101-3a4 in Kubota’s comprehensive line up, boasting a wealth of new features to improve everyday efficiency, ease of use and compliance with industry regulations.&nbsp;The new model also features Kubota’s engine safe start system plus a hydraulic lockout on the left-hand console, and optional safety valves for the boom, arm and dozer.<br></p>', 0, 'New', 'Kubota-KX037-4-Leaflet.pdf.pdf', 'Sold', 0, '2021-06-02', 28, '2021-06-02 14:28:04', '2021-08-11 13:39:42'),
(130, 14, 13, '0', '0', 'Kubota KX042-4a', 'KX042-4a', '2021', '0', '4', '<p>The most environmentally friendly excavator in its class, the KX042-4α incorporates a DPF (Diesel Particulate Filter) to ensure clean exhaust emissions. The KX042-4α is also performance friendly, with a powerful and reliable engine and the versatility you need for every job on the work site.<br></p>', 0, 'New', 'KX042-4a_English_web.pdf', 'Sold', 0, '2021-06-02', 30, '2021-06-02 14:29:34', '2021-08-11 13:39:42'),
(131, 14, 13, '0', '0', 'Kubota KX060-5', 'KX060-5', '2021', '0', '5', '<p><span style=\"text-align: justify;\">The next generation of mini excavators with&nbsp;advanced performance, comfort, and safety.</span><br style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: justify; outline: none !important;\"><span style=\"text-align: justify;\">Kubota’s new 5-ton mini excavators are ready to take charge and deliver new levels of performance, comfort, and safety for a wide range of jobs.</span><br style=\"-webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: justify; outline: none !important;\"><span style=\"text-align: justify;\">All feature newly designed interiors and exteriors, and all are built with the most advanced technology Kubota has to offer.</span><br></p>', 100, 'New', 'KX060-5 Mini-Excavators tech specs.pdf', 'Sold', 0, '2021-06-02', 32, '2021-06-02 14:31:07', '2021-08-11 14:10:30'),
(132, 14, 13, '0', '0', 'Kubota KX080-4α2', 'KX080-4α2', '2021', '0', '8', '<p>Performance that is powerful yet clean, a design that is bold yet practical. It starts with a rugged and reliable direct injection Kubota engine with CRS and a DPF muffler. A new 2-pump load sensing system improves the overall smoothness of operations when using the front attachments. The KX080-4α2 also offers a variety of other improvements that enhance convenience and boost performance and productivity for a wide range of jobs.<br></p>', 0, 'New', 'KX080-4α2 tech specs.pdf', 'Sold', 0, '2021-06-02', 34, '2021-06-02 14:33:00', '2021-08-11 13:49:59'),
(133, 14, 13, '0', '0', 'Kubota U10-3', 'U10-3', '2021', '0', '1', '<p>Super-compact. Highly reliable. The efficient Kubota U10-3, with enhanced operator protection, is the super mini-excavator of choice for tough jobs where space is limited.<br></p>', 0, 'New', 'U10-3.pdf', 'Sold', 0, '2021-06-02', 15, '2021-06-02 14:34:14', '2021-07-09 15:41:49'),
(135, 14, 13, '0', '0', 'Kubota U17-3a', 'U17-3a', '2021', '0', '2', '<p>The U17-3α provides excellent digging depth and reach. Kubota’s U17-3α delivers powerful performance and the use of new short-pitched rubber crawlers helps minimise vibration during travel for improved operator comfort. Kubota’s unique E-TVCS (Three Vortex Combustion System) enables high-energy output, low vibration and low fuel consumption, while minimising exhaust emissions.<br></p>', 0, 'New', 'U17-3a (1).pdf', 'Sold', 0, '2021-06-02', 18, '2021-06-02 14:41:40', '2021-07-15 12:59:08'),
(136, 14, 13, '0', '0', 'Kubota U20-3a', 'U20-3a', '2021', '2021', '2', '<p>Offering precision control for restricted working and a host of advanced features that deliver superior performance and efficiency. With high reliability and low operating costs these minis are ideal for a wide range of jobs.<br></p>', 0, 'New', 'U20-3a_Kuk.pdf', 'Sold', 0, '2021-06-02', 21, '2021-06-02 14:44:07', '2021-07-21 15:45:31'),
(138, 14, 13, '0', '0', 'Kubota U36-4', 'U36-4', '2021', '0', '4', '<p>Handle any job with confidence. The Kubota U36-4 combines superior power and outstanding versatility to tackle demanding jobs in a variety of conditions. Operate auxiliary attachments more easily than ever with precise oil flow control to the auxiliary circuit. A more powerful arm breakout force, combined with an array of enhanced functions, results in the smooth and productive operation Kubota machines are known for.<br></p>', 0, 'New', 'U36-4.pdf', 'Sold', 0, '2021-06-02', 24, '2021-06-02 14:47:01', '2021-07-28 14:29:04'),
(140, 14, 13, '0', '0', 'Kubota U56-5', 'U56-5', '2021', '0', '5', '<p>Kubota’s new 5-ton mini excavators are ready to take charge and deliver new levels of performance, comfort, and safety for a wide range of jobs. All feature newly designed interiors and exteriors, and all are built with the most advanced technology Kubota has to offer.<br></p>', 0, 'New', 'U56-5 Mini-Excavators.pdf', 'Sold', 0, '2021-06-02', 27, '2021-06-02 14:51:54', '2021-08-11 13:31:43'),
(143, 15, 13, '0', '0', 'Kubota KC70H-4', 'KC70H-4', '2021', '0', '0.7', '<p>Thanks to its dimensions and its loading capacity, this KUBOTA KC70H-4 crawler dumper is the ideal working mate&nbsp;for all jobs in the construction activity.<br></p>', 500, 'New', 'KC70H-4 Track Dumpers.pdf', 'Sold', 0, '2021-06-02', 38, '2021-06-02 15:01:07', '2021-08-11 15:13:44'),
(148, 15, 13, 'XYZ123', '0', 'Kubota', 'KC110HR-4', '2021', '0', '1', '<p>With the KC110HR-4, unloading operation is fast and easy. The profile of the skip has been designed to ensure a quick discharge of the material. With a dumping angle of 90°, all material exits easily from the skip. In addition, the rotary function allows you to tip side ways (180°) when filling a trench for example.<br></p>', 0, 'New', 'KC110-HR-4.pdf', 'Sold', 0, '2021-06-02', 37, '2021-06-02 15:12:37', '2021-08-21 11:16:37'),
(154, 6, 15, '0', '0', 'Bison 35', 'Bison35', '2021', '0', '0', '<p>The Bison 35 is a small jaw crusher, providing an ideal solution for construction companies and contractors who want to recycle their construction and demolition waste onsite. The ability to adjust the jaw setting and operate the plant fully from the remote control allows for a fast and simple set up for the customer. With its intuitive operation, quick set-up times, compact size and ease of transport the Bison 35 the ideal solution for all small scale jobs.<br></p>', 0, 'New', 'BISON 35_PRINT.pdf', 'Sold', 0, '2021-06-02', 1, '2021-06-02 17:14:21', '2021-09-10 19:18:43'),
(155, 6, 15, '0', '0', 'Bison 120', 'Bison 120', '2021', '0', '0', '<p>The Bison 120 is a compact jaw crusher has been specifically designed for operators for whom versatility, maneuverability and transportability are of key importance. It is compact enough to fit inside a container for transport but strong enough to withstand the toughest of applications. The Bison 120 features a ‘680mm x 400mm’ single toggle Jaw Crusher that can be adjusted hydraulically using the remote control which comes as standard with the machine. The Jaw is driven hydraulically allowing the customer the ability to reverse the Crusher to clear a blockage as well as being able to run in reverse permanently for sticky applications such as asphalt. The ability to adjust the jaw setting and operate the plant fully from the remote control allows for a fast and simple set up for the customer. With its intuitive operation, quick set-up times, compact size and ease of transport the Bison 120 the ideal solution for all small to medium sized operators.<br></p>', 0, 'New', 'Bison 120 Brochure 2021.pdf', 'In Stock', 0, '2021-06-02', 12, '2021-06-02 17:20:09', '2021-06-24 15:04:33');
INSERT INTO `products` (`id`, `category_id`, `dealer_id`, `stock_number`, `backorder_number`, `title`, `model`, `year`, `hours`, `weight`, `description`, `price`, `type`, `attachment`, `status`, `upcoming_quantity`, `date`, `order_no`, `created_at`, `updated_at`) VALUES
(156, 13, 13, '0', '0', 'Kubota R070', 'R070', '2021', '0', '3', '<p>A long reach and excellent lifting power make all types of material handling jobs easy. Built for comfort and simple operation – even by operators with no loader experience – with all the power you need and a high visibility, fully glass enclosed cabin.<br></p>', 100, 'New', 'R070 Wheel loaders.pdf', 'Sold', 0, '2021-06-02', 35, '2021-06-02 17:20:19', '2021-08-11 14:19:22'),
(157, 6, 15, '0', '0', 'Bison 160 Hybrid', 'Bison160', '2021', '0', '0', '<p>The Bison 160 Hybrid hook-lift jaw crusher represents a new milestone for EvoQuip. It is an ideal crusher for waste contractors who can utilize existing hook-lift vehicles to either bring material to depot for processing or alternatively bring the crusher to the waste on site – turning waste into profit whilst providing excellent productivity and fuel efficiency.<br></p>', 0, 'New', 'Bison 160 Brochure 2020.pdf', 'In Stock', 0, '2021-06-02', 6, '2021-06-02 17:23:24', '2021-06-24 15:04:33'),
(158, 13, 13, '0', '0', 'Kubota R090', 'R090', '2021', '0', '3', '<p>A long reach and excellent lifting power make all types of material handling jobs easy. Built for comfort and simple operation – even by operators with no loader experience – with all the power you need and a high visibility, fully glass enclosed cabin.<br></p>', 0, 'New', '', 'Sold', 0, '2021-06-02', 36, '2021-06-02 17:23:33', '2021-07-28 14:12:12'),
(159, 6, 15, '0', '0', 'Bison 280', 'Bison 280', '2021', '0', '0', '<p>The Bison 280, a compact and aggressive portable jaw crusher featuring the proven Terex ‘900mm x 600mm’ single toggle jaw crusher. This machine utilizes an extremely fuel efficient and powerful ‘Direct Drive’ system to power the Crusher which provides excellent performance in recycling, contracting and quarrying industries. Its compact size, quick set-up times, ease of transport and user friendly control system makes the Bison 280 the ideal solution for all small to medium sized operators.<br></p>', 0, 'New', 'Bison 280 Crusher - Terex.pdf', 'In Stock', 0, '2021-06-02', 13, '2021-06-02 17:34:52', '2021-06-24 15:04:33'),
(160, 6, 15, '0', '0', 'Cobra 230', 'Cobra230', '2021', '0', '0', 'The Cobra 230 is the Portable Impact Crusher from EvoQuip. No matter what line of work you’re in, whether it is Construction &amp; Demolition, Asphalt Recycling, Quarrying or Contract Crushing the Cobra 230 will enhance your profitability. The Cobra 230 Impact Crusher is a machine that provides class leading productivity, unmatched versatility and excellent fuel efficiency. The quick set up times, simple intuitive operation and ease of transport makes this machine an ideal solution for all applications.<br><div class=\"col-md-12\" style=\"min-height: 1px; padding-left: 0.935em; padding-right: 0.935em; float: left; width: 900px; color: rgb(51, 51, 51); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: medium;\"></div>', 0, 'New', 'Cobra 230 Brochure.pdf', 'In Stock', 0, '2021-06-02', 7, '2021-06-02 17:39:30', '2021-06-24 15:04:33'),
(162, 6, 15, '0', '0', 'Cobra 290', 'Cobra290', '2021', '0', '0', '<p>The Cobra 290 Tracked Impact Crusher is a machine that provides class leading productivity, unmatched versatility and excellent fuel efficiency. The quick set up times, simple intuitive operation and ease of transport makes this machine an ideal solution for all applications.<br></p>', 0, 'New', 'cobra-290_290r-brochure_web.pdf', 'In Stock', 0, '2021-06-02', 8, '2021-06-02 17:51:10', '2021-06-24 15:04:33'),
(163, 14, 13, '0', '0', 'Kubota KX042-4', 'KX042-4', '2021', '0', '4', '<p>The most environmentally friendly excavator in its class, the KX042-4 incorporates a DPF (Diesel Particulate Filter) to ensure a clean exhaust, plus Kubota’s ECO Plus Mode to reduce fuel consumption. The KX042-4 is also performance friendly, with a powerful and reliable engine and the versatility you need for every job on the work site.<br></p>', 0, 'New', 'KX042-4 Old models (1).pdf', 'Sold', 0, '2021-06-02', 29, '2021-06-02 17:51:50', '2021-08-11 13:39:42'),
(164, 14, 13, '0', '0', 'Kubota KX057-4', 'KX057-4', '2021', '0', '5.5', '<p>Combining the power for demanding jobs and the versatility to work in any condition, the Kubota KX057-4 is ready to take on any challenge. This advanced 5.5 tonne machine is the most powerful excavator in our mini range. It’s designed with excellent stability to work with a variety of attachments. Versatility is greatly enhanced with two auxiliary circuits as standard and precise oil flow control. With upgraded digging and lifting power, smoother travel performance and upgraded versatility, this Kubota truly has it all.<br></p>', 100, 'New', 'Kubota-KX057-4.pdf', 'Sold', 0, '2021-06-02', 31, '2021-06-02 17:53:37', '2021-08-11 14:10:30'),
(165, 14, 13, '0', '0', 'Kubota KX080-4α', 'KX080-4α', '2021', '0', '8', '<p>Performance that is powerful yet clean, a design that is bold yet practical. It starts with a rugged and reliable direct-injection Kubota engine with CRS and a DPF muffler. Eco e PLUS mode provides even greater fuel and work efficiency. A new 2-pump load sensing system improves the overall smoothness of operations when using the front attachments. The KX080-4α also offers a variety of other improvements that enhance convenience and boost performance and productivity for a wide range of jobs.<br></p>', 100, 'New', 'KX080-4a.pdf', 'Sold', 0, '2021-06-02', 33, '2021-06-02 17:55:40', '2021-08-11 14:19:22'),
(176, 14, 13, '0', '0', 'Kubota U48-4', 'U48-4', '2021', '0', '4.7', '<p>This advanced 4.7 tonne machine is designed with excellent stability to work efficiently even where space is confined. Versatility is greatly enhanced with two auxiliary circuits as standard (L spec model only) and precise oil flow control. With upgraded digging and lifting power and smoother travel performance, this Kubota truly has it all.<br></p>', 0, 'New', 'U48-4 Old models.pdf', 'Sold', 0, '2021-06-02', 25, '2021-06-02 18:19:02', '2021-08-04 17:05:33'),
(177, 14, 13, '0', '0', 'Kubota U55-4', 'U55-4', '2021', '0', '5.4', '<p>Combining the power for demanding jobs and the versatility to work in any condition, the Kubota U55-4 is ready to take on any challenge. This advanced 5.4 tonne machine is designed with excellent stability to work efficiently even where space is confined. Versatility is greatly enhanced with two auxiliary circuits as standard and precise oil flow control. With upgraded digging and lifting power and smoother travel performance, this Kubota truly has it all.<br></p>', 5000, 'New', 'U55-4 Old models.pdf', 'Sold', 0, '2021-06-02', 26, '2021-06-02 18:21:24', '2021-07-12 15:41:03'),
(178, 6, 15, '0', '0', 'Cobra 290R', 'Cobra290R', '2021', '0', '0', '<p>The Cobra 290R is a versatile and easy to use Track Mounted Impact Crusher that can operate in the most demanding of applications such as Reinforced Concrete, Recycled Asphalt, Construction and Demolition waste and Natural Rock. The integrated Afterscreen system on the Cobra 290R ensures the required product specification is achieved with oversize material either being recirculated back to the Crusher or else stockpiled.<br style=\"\"><br style=\"\">The Cobra 290R is available with the wind sifter as an option, providing the ideal solution to remove contaminants &nbsp;such as plastic and wood from crushed C&amp;D waste based on density and size.<br style=\"color: rgb(51, 51, 51); font-family: &quot;Roboto Condensed&quot;, sans-serif; font-size: medium;\"></p>', 0, 'New', 'cobra-290_290r-brochure_web.pdf', 'In Stock', 0, '2021-06-02', 9, '2021-06-02 18:33:17', '2021-06-24 15:04:33'),
(179, 6, 15, '0', '0', 'Colt 800', 'Colt800', '2021', '0', '0', '<p>The Colt 800 Mobile Screening Machine is a compact and aggressive forward facing incline screen. This versatile plant can work in aggregates, sand and gravel, top soil, construction demolition and recycling applications where site space is at a premium. The highly aggressive screenbox can accept a range of media including bofor bars, finger screens, woven mesh and punch plates. Its compact size, quick set-up times, ease of transport and ease of operation makes the Colt 800 Scalping Screen the ideal solution for all small to medium sized operators.<br></p>', 0, 'New', 'Colt 800 Brochure Feb 19.pdf', 'In Stock', 0, '2021-06-02', 54, '2021-06-02 18:46:34', '2021-06-24 15:04:33'),
(180, 6, 15, '0', '0', 'Falcon 1220', 'Falcon 1220', '2021', '0', '0', '<p>The Falcon 1220 Mobile Inclined Screen combines scalping, screening and stockpiling into one self contained unit. Its rugged design enables it to handle materials such as sand and gravel, crushed stone, coal, topsoil and demolition waste. Not available in North America or Australia.<br></p>', 0, 'New', 'Falcon 1220_Print.pdf', 'In Stock', 0, '2021-06-02', 10, '2021-06-02 18:50:59', '2021-06-24 15:04:33'),
(182, 6, 15, '0', '0', 'Colt 600', 'Colt600', '2021', '0', '0', '<p>The Colt 600 Compact Scalping Screen has been specifically designed for operators for whom versatility, maneuverability and transportability are of key importance. It is small enough to fit inside a container for transport but strong enough to withstand the toughest of applications. The Colt 600 is a compact and aggressive forward facing screen that can work in aggregates, sand and gravel, top soil, construction demolition and recycling applications where site space is at a premium. With the large range of screen media available including bofor bars, finger screens, woven mesh and punch plates it provides the user with a level of versatility that is second to none.<br></p>', 0, 'New', 'Colt 600 Brochure Feb 19.pdf', 'In Stock', 0, '2021-06-02', 53, '2021-06-02 18:56:46', '2021-06-24 15:04:33'),
(183, 6, 15, '0', '0', 'Colt1000', 'Colt1000', '2021', '0', '0', '<p>The highly adaptable Colt 1000 Scalping screen is able to operate in both heavy duty scalping and precision screening applications and will manage the most difficult of materials. The Colt 1000 achieves a compact footprint maintaining the ethos of the EvoQuip range while achieving versatility and mobility. Flexibility is enhanced with configurable conveyor options and two way split conversion. Featuring an aggressive double deck screen, variable screening angle with numerous screen media options, broad fines conveyor, quick set up time and tall discharge heights ensures the Colt 1000 distinguishes itself amongst its competition.<br></p>', 0, 'New', 'Colt 1000 Brochure Feb 19.pdf', 'In Stock', 0, '2021-05-02', 52, '2021-06-02 18:58:59', '2021-06-24 15:04:33'),
(184, 6, 15, '0', '0', 'Colt 1600', 'Colt1600', '2021', '0', '0', '<p>The high capacity, versatile heavy duty Colt 1600 Screener Machine is designed to work in primary and secondary screening applications. With the single, triple shaft and Spaleck screen box options the applications are endless&nbsp; The Colt 1600 is available with dual power technology giving flexibility to be powered by an external power supply or the standard on-board engine.<br style=\"\"><br style=\"\">Flexibility is enhanced with configurable conveyor options and two way split conversion.<br style=\"\">Tall discharge heights can be improved further with optional telescopic conveyors and the wide array of screen media available makes this the perfect multi-purpose machine.&nbsp;<br></p>', 0, 'New', 'Colt 1600 Brochure Mar 20.pdf', 'In Stock', 0, '2021-06-02', 55, '2021-06-02 19:01:30', '2021-06-24 15:04:33'),
(185, 6, 15, '0', '0', 'Falcon 1230', 'Falcon 1230', '2021', '0', '0', '<p>The Falcon 1230 portable inclined screen is a compact easily transportable machine that offers operators rapid set up and tear down times.<br></p>', 0, 'New', 'Falcon 1230_Print.pdf', 'In Stock', 0, '2021-06-02', 11, '2021-06-02 19:03:45', '2021-06-24 15:04:33'),
(186, 6, 15, '0', '0', 'Harrier 220', 'Harrier220', '2021', '0', '0', '<p>The Harrier 220 Compact Scalping Screen is a small yet robust machine designed for recycling, composting, topsoil, landscaping, and contract building industries. Its compact size, quick set-up times, ease of transport and ease of operation makes the Harrier 220 the ideal solution for small scale operations<br></p>', 0, 'New', 'HARRIER 220_PRINT.pdf', 'Coming Soon', 0, '2021-06-02', 3, '2021-06-02 19:07:37', '2021-09-10 19:18:25'),
(187, 6, 15, '0', '0', 'Harrier 750', 'Harrier 750', '2021', '0', '0', '<p>The Harrier 750 is a high capacity Mobile Screening Machine. With its robust construction the Harrier 750 can withstand the toughest scalping applications while still being versatile enough to perform at a high level in fine screening applications. It really is the perfect multipurpose machine for your site.<br></p>', 0, 'New', 'HARRIER 750_PRINT.pdf', 'In Stock', 0, '2021-06-02', 45, '2021-06-02 19:10:06', '2021-06-24 15:04:33'),
(225, 5, 10, '0', '0', 'Liugong 9027F Stage V', '9027F Stage V', '2021', '0', '28', '<ul style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; margin: 10px 0px 0px; padding: 0px 15px 10px 30px; list-style-position: initial; list-style-image: initial; border: none; background-image: url(&quot;../images/kv/bg.png&quot;); background-position: initial; background-size: initial; background-repeat: repeat; background-attachment: initial; background-origin: initial; background-clip: initial;\"><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">Take a walk around the new 9027FZTS and you will see the difference. It’s a compact machine that delivers on all the big essentials that matter to you.</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">When space is tight, the neat compact design with zero tailswing and boom swing gets you to work. With the upper frame and counter-weight sitting within the width of the tracks the 9027FZTS can squeeze into the tightest jobsites without damaging the machine or surrounding environment.&nbsp; The agile offset boom swing control allows the 9027FZTS to deliver even greater versatility allowing you to dig right alongside the tracks. Simple push button selection and trackwheel control enable the boom to swing 74-degrees to the left and 54.5-degrees to the right.&nbsp; Whatever the space challenge, the 9027FZTS takes it in its stride.</li></ul>', 0, 'New', '9027F Stage V 16 Pg A4 Broch_03_2021.pdf', 'In Stock', 0, '2021-06-15', 62, '2021-06-15 16:12:52', '2021-06-24 15:04:33'),
(226, 5, 10, '0', '0', 'Liugiong 922E Stage IV', 'Liugiong 922E Stage IV', '2021', '0', '23', '<ul style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; margin: 10px 0px 0px; padding: 0px 15px 10px 30px; list-style: none; border: none; background-image: url(&quot;../images/kv/bg.png&quot;); background-position: initial; background-size: initial; background-repeat: repeat; background-attachment: initial; background-origin: initial; background-clip: initial;\"><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">Unmatched performance driven by the Cummins Engine enhances torque output with more power and breakout force at lower engine speeds.</li><li style=\"-webkit-tap-highlight-color: transparent; -webkit-font-smoothing: antialiased; padding: 0px; margin: 0px 0px 10px; list-style: disc; border: none;\">Options for auxiliary hydraulic piping include bidirectional variable high flow line, an additional line for rotating attachments and also a single acting line. The quick coupler further ensures you get the most out of your machine by easily switching between a wide range of attachments to suit any application.</li></ul>', 0, 'New', '922E_925E T4F 44 Pg Broch A4_12_2020 (1).pdf', 'In Stock', 0, '2021-06-15', 63, '2021-06-15 16:15:44', '2021-06-24 15:04:33'),
(227, 5, 10, '0', '0', 'liugong 928E－Stage IV', '928E－Stage IV', '2021', '0', '28', '<p>Ergonomically designed controls, clear and informative displays, increased visibility, and exceptional comfort increases operator efficiency and safety. Options for auxiliary hydraulic piping include bi-directional variable high flow lines, an additional line for rotating attachments and a single acting line. Meet the highest European safety legislation, including quick coupler alert safety system, walking alarm, overload alarm and a 2-inch red retractable seat belt.<br style=\"\"><br style=\"\">Well-positioned components allows for quick reach and easy assessment during routine maintenance. Demolition guards and handrails are designed and manufactured to ensure your operators safety under demolition applications.<br></p>', 0, 'New', 'liugong_924e_928e_933e_939e_eng_0-1.pdf', 'In Stock', 0, '2021-06-15', 64, '2021-06-15 16:21:03', '2021-10-22 18:10:24'),
(228, 5, 10, '0', '0', 'Liugong 930E Stage V', '930E Stage V', '2021', '0', '33', '<p>Unmatched performance driven by the Cummins engine maximizes torque output with more power and breakout force at lower engine speeds. Ergonomically designed controls, clear and informative displays, increased visibility, and exceptional comfort increases operator efficiency and safety. ROPS (Roll Over Protection System) and FOPS (Falling Object Protection System) safeguard your most important asset: your operator in the toughest environment.<br style=\"\"><br style=\"\">Greater hydraulic flow and higher swing speeds combine to improve cycle times by 12% on tasks such as truck loading, digging, trenching and backfilling compared with our previous model.<br></p>', 0, 'New', 'HEX-930E-Stage-V-28-Pg-A4-Broch_06_20201.pdf', 'In Stock', 0, '2021-06-15', 65, '2021-06-15 16:24:00', '2021-06-24 15:04:33'),
(229, 5, 10, '0', '0', 'Liugong 933E Stage V', '933E Stage V', '2021', '0', '33', '<p>Heavy duty rollers, reinforced idler frame and optional full track guard guarantee the integrity of our undercarriage. It’s this core strength that enables our customers to keep working and earning – around the clock.<br style=\"\"><br style=\"\">ROPS (Roll Over Protection System) and FOPS (Falling Object Protection System) safeguard your most important asset: your operator in the toughest environment.<br style=\"\"><br style=\"\">Visibility is key to protecting your operator and workers on site. The large glass surface area, increased by 15% on the E-series cab compared with our previous model, combined with the rear-view camera, provides an extraordinary view of the 933E’s surroundings.<br></p>', 0, 'New', 'liugong_924e_928e_933e_939e_eng_1.pdf', 'In Stock', 0, '2021-06-15', 66, '2021-06-15 16:26:13', '2021-06-24 15:04:33'),
(230, 5, 10, '0', '0', 'Liugong 936E Stage V', '936E Stage V', '2021', '0', '37', '<p>Proven negative flow hydraulics have optimized the main control valve, improved the speed of front end cylinders, while cutting down the hydraulic system’s damper loss, leading to much better working efficiency.<br style=\"\"><br style=\"\">Fuel efficient Cummins engine comes with a combination of a proven cooled-EGR system.<br style=\"\"><br style=\"\">The LiuGong E series excavator features 6 selectable working modes that optimize performance and fuel consumption to your specific conditions.<br style=\"\"><br style=\"\">E series cab high-strength ROPS ensures operator protection. Falling Object Protection System (FOPS) is optional.<br></p>', 0, 'New', 'HEX-936E-Stage-V-28-Pg-A4-Broch_06_2020.pdf', 'In Stock', 0, '2021-06-15', 67, '2021-06-15 16:28:28', '2021-06-24 15:04:33'),
