(256, 17, 13, '0', '0', 'Kubota RTV X1110', 'RTV X1110', '2021', '0', '1', '<p>The all-new RTV-X1110 offers greater power and more versatility thanks to a powerful and economical 24.2 HP Kubota 3-cylinder liquid cooled ETVCS diesel engine. Thanks to its unique drive train arrangement, the RTV-X1110 goes where other utility vehicles can’t. Kubota’s innovative VHT-X variable hydrostatic transmission and dynamic engine braking makes the RTV-X1110 one of the safest utility vehicles on the market. With its rapid acceleration and gripping traction, the RTV-X1110 can stop and resume climbing without the need for braking. Ergonomically designed for effortless operation and optimum driver and passenger comfort; the RTV-X1110 features deluxe split-bench seats, digital&nbsp;<font color=\"#9b9b9b\" face=\"Open Sans, sans-serif\"><span style=\"border-style: initial; border-color: initial; border-image: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; outline-color: initial !important; outline-width: initial !important;\">easy-read&nbsp;</span></font>instrument panel, under seat storage with full ROPS protection designed for easy access to a hydraulic cargo tipping bed.&nbsp;<br></p>', 0, 'New', 'RTV-Brochure-Digital.pdf', 'Sold', 0, '2021-06-24', 93, '2021-06-24 15:23:42', '2021-08-21 14:15:30'),
(257, 17, 13, '0', '0', 'Kubota RTV-X1140', 'RTV-X1140', '2021', '0', '1', '<p>Ready for the season, the new RTV-X1140 offers exceptional versatility, power and all year round capability. Carrying up to 4 guns (plus dogs) comfortably, the RTV-X1140 is designed to work on the toughest terrains. A powerful 3 cylinder 24.8HP engine combined with Kubota’s unique variable hydro transmission delivers excellent acceleration, optimum traction and unrivalled hill control. Whether it’s carrying guns to hauling heavy loads, the RTV-X1140 provides a flexible choice, converting simply in 3 easy steps to access a full cargo bed capacity.<br></p>', 0, 'New', '', 'Sold', 0, '2021-06-24', 94, '2021-06-24 15:31:14', '2021-08-30 16:01:12'),
(258, 13, 13, '12345', '0', 'Kubota R070', 'R070', '2021', '0', '3', '<p>A long reach and excellent lifting power make all types of material handling jobs easy. Built for comfort and simple operation – even by operators with no loader experience – with all the power you need and a high visibility, fully glass enclosed cabin.<br></p>', 0, 'New', 'R070 Wheel loaders.pdf', 'Sold', 0, '2021-06-02', 95, '2021-07-14 17:36:44', '2021-09-14 15:07:46'),
